Review.create!([
  {compensation_id: 0, review_content: "I bought two of these bowl brushes and am happy with the quality and weight. My old bowl brushes cost me about 3 times as much and was way more flimsy and cheap feeling. This brush and it's holder are far better for way less money. The design fit my modern bathroom design.", product_id: 1, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I generally use a French press or a Keurig. However, for some variety I purchased this product. It looks sleek and the coffee is very good! I wish it was maybe a little bit larger but it can make 4 cups! ", product_id: 2, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "The press is incredibly sturdy deposit the super low price point. I would say the build quality is heavy and durable. The same tool of lesser quality at Whole Foods is around $20", product_id: 3, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "My boyfriend bought these for me and I liked them because the designs aren't as bad as some of the other scrunchies at this price point. Still not my favorite designs but they're kind of cute still. The most important thing is they are very light and the material helps because it is slick/soft.", product_id: 4, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "The variety of straws allows me to use a Green- Eco friendly straw for my varying sizes of liquid containers. Living in SF it is almost a requirement to use Steel or Paper - and I prefer metal. Solid build quality!", product_id: 5, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "The mirror is much better than the low price would suggest. The large surface area allows me to easily line the back of my neck when shaving. Solid addition to shaving kit.", product_id: 6, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "My favorite part about the squeezer is the chrome finish + the ease of which it dispatches juice out of lemons! The chrome finish feels sturdy like it will last.", product_id: 7, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "The cable is so long I never have to worry about not being able to charge my cellphone reliably. I definitely use less batteries on my Xbox controller now! Tbt to battleries?! Right!?!!", product_id: 8, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This is the most delicious almond butter I have ever tasted.  There is something about the way that Trader Joes roasts the almonds, then lightly salts the butter.  I always buy the crunchy type.  Have enjoyed this almond butter for the past 3 years, repeat buy.", product_id: 9, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This is a very strong antiperspirant, as well as deodorant.  If you are like me, and have been forced to discard perfectly good items of clothing due to perspiration smell, this will help.  It helped me.  I apply it 2x/day as instructed, and it has saved my wardrobe.", product_id: 10, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This dress can be dressed up or down.  For everyday wear such as running errands or working (at home in my case).  It is stretchy and soft, does not pull or bind.  If you wear this with a pretty pair of shoes and delightful earrings you will feel decorated and relaxed at the same time. ", product_id: 11, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This dress is chic!  And comfortable as well.  I wear it with a pair of white gladiator sandals and pretty earrings and feel dressed.  I can and do wear it everywhere, day or night.  It washes well, but I do not put it in the dryer.  Do not want it to fade or wear out too quickly.", product_id: 12, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This whitening kit is easy to use and the price is good.  It has not caused me any tooth sensitivity and my teeth are whiter.  Since I drink green tea and coffee every day, I need a whitening kit.  I also love the price!  Just have to be careful not to use it too often, since that might cause thinning of tooth enamel.  I follow directions on the box.", product_id: 13, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "The only thing I like about this is the variety of sizes. What I dislike about this is that the bags don't stay compressed for very long (most of them started expanding after a day, which makes them useless for storage), they're flimsy (2 tore while being filled with bedding despite me being careful), and they don't even get as compressed/flat as advertised (despite not overfilling them). ", product_id: 14, ratings: 1, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I was a bit skeptic because it was so cheap. However, it was worth every penny. It fits the contours of my hand perfectly, and it is sensitive enough that it doesn't irritate my arthritis. I like the side scroll feature that allows me to change windows, in addition, the scroll wheel that allows me to move up and down. I have had to change the batteries once a year.  I have tried to use a wired mouse once since I received this one. It felt so cumbersome and annoying, I drove back home at my first opportunity to pick up this one.", product_id: 15, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This was exactly what I needed.  So much show that I don't use my regular pillows anymore. It majorly helped with my back and neck issues. It also comes in handy when I need a supportive back when I sit on the floor to work on my laptop. I kind of wish the cover was removable so that it is easier to clean, but overall, I am 5 with this pillow.", product_id: 16, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "First, I like that it has 2 built-in fans, and an adjustable/retractable USB cable to connect to my laptop.  It also has a space for my cell phone and drawer for storage. I love that it is made of Bamboo, and is remarkably sturdy.  My goddaughters (ages 3-8) have all at one point stepped on, knocked it off a table, or tried to sit on it. So far, it has survived.  Because of its adjustable height, I can place it on a table or counter and turn it into a standing work desk.  What I dislike is that I can't detach the cover over the fans, making it difficult to clean (not impossible) to clean the fans.  However, they work really well at keeping my laptop from overheating.", product_id: 17, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I love that it is certified organic. I love the aroma when you first open the package. The maple syrup odor is not overwhelming and doesn't seem to linger as it does with the capsules. It makes a delicious tea. When mixed with fennel seeds, it has a settling effect on my stomach and has helped tremendously when sipped post meals. Also, makes a good hair rinse after a mask treatment.", product_id: 18, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I ordered this because the powder that I normally buy was out of stock. In addition, this company has a pretty decent reputation, so I felt relatively safe that I wasn't going to get MSM powder mixed with anything else. I really like how quickly this powder dissolves in liquid. I like that is Non-GMO and that it is a vegan product.  What I really dislike is that, unlike the other powders that I have used in the past, this one does not come with any sort of measuring instrument. The size of the bottle can accommodate one, so I'm not sure why it isn't included. I also don't like that is can leave a bit of an aftertaste at 1/2 teaspoon, so I had to cut the recommended dosage. I think this is a decent alternative/ backup to my usual product choose.", product_id: 19, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like that it's affordable, that the towels are fairly soft, and that the set includes 2 of everything. I dislike that the threads began unraveling after 3 washes, that the towels shed like crazy, and that the towels take a long time to dry.", product_id: 20, ratings: 2, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like that it's easy to mount (only took a few minutes), that it doesn't take up a lot of space, that it's fairly powerful (despite its size), and that it comes with a nightlight attached. The only thing I dislike about it is that it's a bit louder than most hair dryers.", product_id: 21, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "Graphics of Tom Clancy's The Division is awesome. But game story is not that much impressive. Honestly little boring. I didn't face any glitches during game. ", product_id: 22, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like that they're affordable, eco-friendly, soft without being flimsy, stuffed completely (no gaps at all), and hold their shape fairly well (even after over 3 years). The only thing I dislike is that they're a little too narrow--it would be nice if they were just 2 inches wider.", product_id: 23, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like that it is very compact (can fit in even the tiniest overhead bins), durable, has a long handle, has wheels that roll very smoothly, is surprisingly roomy (used it as only suitcase for a week long trip and I don't pack light), can be compressed and expanded, is aesthetically-pleasing, and is very affordable. The only thing I dislike about it is the combination lock because, despite the instructions, I still can't figure out how to use it; it's also possible that it's just broken. ", product_id: 24, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like that it is very accurate and consistent, compact, easy to read, capable of taring, has a large capacity, and has a mailer holder that can be used to weigh packages that are awkwardly-shaped. There's nothing that I dislike about it.", product_id: 25, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "The only thing I like about it is that it's cheap. What I dislike about it is that it's consistently off by at least 4 pounds, it's flimsy (the triangle connecting the body to the the part were the luggage hands bent when measuring luggage significantly under the weight capacity), and that the battery died about a week after I purchased it. ", product_id: 26, ratings: 1, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like how modern it looks, that the arms are adjustable, that it's dimmable, and that it's sturdy (once the arms are properly positioned, they stay there instead of swinging around and also the base is nice and heavy so the entire thing can't tip over). What I dislike about it is how difficult it was to assemble (the instructions were terrible), that it's at least 6 inches taller than advertised (but luckily I have high ceilings, so this wasn't an issue), and that the base is ugly.", product_id: 27, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "If you love great coffee, buy this machine. When I say great coffee, I mean the kind of coffee you would expect and get from your favorite local coffee roaster/caf?? or quality coffee shop (think Starbucks or Peet's, NOT the tasteless brown water that Dunkin' Donuts sells).    I've wanted a Moccamaster since I first saw one and tasted the coffee it makes while a college student, way back in the 1980s. Owning one at the time was impractical and unattainable, so I moved on. Over the intervening thirty years, I've always lingered enviously over the store displays whenever I encountered them, but never made the plunge?�?the machine was just too expensive. That being said, I've owned the best coffee makers from Braun, Krups, Kitchen Aid, and Breville, all of which made decent coffee. In fact, the Breville made great coffee, although its cost was dangerously close the the Technivorm's. That machine was the no-longer-available Breville BKC600XL Gourmet Single-Cup Coffee Brewer?�?the only Keurig system coffee maker the brewed hot enough for decent extraction. That machine lasted eight years, but finally shorted out due to perforation of the boiler element because of it's aluminum construction.", product_id: 28, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "Yes it has a real time fpv camrea the only thing u need is a android or apple product then just download the skyma fpv app everything else is already included!  Note: Do not solely rely on the fpv cam for flying as it has some delay and glitche! But the recorded video turns out pretty good! This Cheerwing Syma X5SW-V3 Drone has built-in 6-axis gyro based on 4 channels ensures a stable and fast flight, ensures a stable and fast flight. Wifi FPV Real-time Transmission, Headless Mode, One key 360?? roll, make it as an Ideal Gift Toys for kids and adults, beginners, pilots of all skill levels.", product_id: 29, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "They have only size 38mm(40mm) and 42mm(44mm) strap,42mm(44mm) fits for 145?�?220mm(5.7\"-8.79\") wrists.   An innove pin-and-tuck closure ensures a clean fit. Metal parts made with hypoallergenic nickel free stainless steel. Soft silicone with smooth finish for a sporty look. Comfortable and durable.  Band comes with Watch Lugs on both ends, which locks onto Watch Band Interface precisely and securely. Easy and direct installation and one button removal.  ONE YEAR WARRANTY: We promise 100% satisfaction customer service & free replacement or refund warranty. If your watch bands have any quality issue.Please contact us we unconditionally send you a new replacement one", product_id: 30, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "100% Handmade Necktie. Features black background with small white DNA motif. Slightly narrower than a classic tie, measures 2.75\" wide for a modern look and feel (this is 1/4\" narrower than a standard tie, and wider than most \"skinny ties.\" ) Subtle and Professional - makes the perfect gift for a scientist, biologist, or geneticist in your life. Tie is handmade of 100% Microfiber - has a high-end look and feel. Tie features loop on back. Standard length.", product_id: 31, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "100% Handmade Necktie. Features Blue background with small light gray telescope & stars motif. Slightly narrower than a classic tie, measures 2.75\" wide for a modern look and feel (this is 1/4\" narrower than a standard tie, and wider than most \"skinny ties.\" ) Subtle and Professional - makes the perfect gift for an astronomer, astrologer, or stargazing enthusiast in your life. Tie is handmade of 100% Microfiber - has a high-end look and feel. Tie features loop on back. Standard length.", product_id: 32, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "100% Handmade Necktie. Features light gray background with black cat in sunglasses motif. Slightly narrower than a classic tie, measures 2.75\" wide for a modern look and feel (this is 1/4\" narrower than a standard tie, and wider than most \"skinny ties.\" ) Subtle and Professional - makes the perfect gift for a cat parent, veterinarian, or cat lover in your life. Tie is handmade of 100% Microfiber - has a high-end look and feel. Tie features loop on back. Standard length.", product_id: 33, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "100% Handmade Necktie. Features Dark gray background with small light gray scissors motif. Slightly narrower than a classic tie, measures 2.75\" wide for a modern look and feel (this is 1/4\" narrower than a standard tie, and wider than most \"skinny ties.\" ) Subtle and Professional - makes the perfect gift for a barber, hairstylist, or fashion designer in your life. Tie is handmade of 100% Microfiber - has a high-end look and feel. Tie features loop on back. Standard length", product_id: 34, ratings: 4, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I love this mic and condenser because it makes my music quality sound so good. I disliked the mic stand because it?�?s not stable ", product_id: 35, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This eyeliner is soft, but not so soft that it smears.  It is soft enough never to scratch the eye.  This is important since I use it for tightlining.  The price is good, and this is not surprising since L'Oreal is always fair about price.  Important for us working folk!  I like the color selection too.", product_id: 36, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I feel so much better when taking a high-strength B complex.  I discovered the magic of taking high-strength B complex 15 years ago, when suffering from fatigue and irritability.  This formula is better than many since it uses a patented methylation process to make sure that all the B vitamins are absorbed.  Since some people cannot absorb some of the Bs correctly, this formula is superior.  ", product_id: 37, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like the flavor of these lozenges.  They really do work to make me feel calmer, quickly.  The effect is mild, they do not make me sleepy or lethargic.  Just softer and more relaxed, less likely to become aggravated.  When my adult daughter starts a conversation that I know will aggravate me, I place one of these under my tongue and then just nod my head.  Peace in the valley!", product_id: 38, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I have been taking 2 capsules, 5 days a week for almost 2 years.  I started taking this for joint pain, and it worked.  What a relief, I was really starting to avoid moving around due to wandering osteoarthritis pain that came and went all over my body.  I dreaded going on medication for that, heard that the meds would destroy my stomach.  I tried this, and within 2 weeks the pain vanished!  My skin has also gotten much prettier, this nutrient is good for so many things!", product_id: 39, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This blend is ideal for heart health, with a combination of olive oil and fish oil.  The lemon flavor masks the fish taste, which is faint.  I like taking a tablespoon of this each morning from the spoon washed down with my protein shake.  This allows me to start the day with a powerhouse supply of nutrients for brain and body.", product_id: 40, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This whey powder is easy to use and tastes delicious.  I have been using this for 10 years.  Occasionally I have been tempted by other brands, and have tried those.  I always come back to Designer Whey.  I like it that they constantly conduct scientific research into how to make the product better, to support health and muscle development.", product_id: 41, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I love the flavor of this coffee.  It has the delicious semi-burnt flavor that is characteristic of Starbucks.  I like the single-serving packets, and it is much less expensive per serving than going to a Starbucks store to be served.  I never want to be without this coffee, and always order ahead.", product_id: 42, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I love the flavors from Sobe, particularly the Blood Orange.  When I buy a Sobe, I get to have a treat without the sugar load.  All the flavors taste fresh, a little tart but sweet enough.  The size is good, can sip a 20 ounce all afternoon without worrying about tooth decay.", product_id: 43, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "This is the most delicious oatmeal I have ever eaten.  I like the pouches that allow me to quickly make just one serving at a time.  Ground flax seed is included, which adds flavor.  And all the fiber is good for lowering cholesterol!", product_id: 44, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like that they're durable, that the set includes a variety of sizes, that the set includes cooking utensils, that they're dishwasher safe, that they're oven-safe, that they haven't rusted at all (despite being washed many times over the past 3 years), that there are virtually no scratches yet (even after 3 years of constant use), that all except the frying pans have measurement markings inside, that the set includes a steamer basket and boiler basket (not many sets do), that it can be used on any type of stovetop (including induction), and that they're nicely weighted without being too heavy. The only thing I dislike about this set is that things stick to the pans, but that can be mostly avoided with a few tricks.", product_id: 45, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "For $3 this was a steal from Marshall's. It's 15\" long so it's perfect for cleaning my blender which I use daily.  It's mainly made of a thin plastic but seems pretty sturdy.", product_id: 46, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "I like that the blades are incredibly sharp and stay sharp (I've had them for 3 years and haven't had to sharpen them yet), that the blades are stainless steel, that they don't rust (even when I let them air-dry), that the set includes every type of knife I need, and that the knives are fairly lightweight while still being sturdy/durable. The only thing I dislike about this is that the handles aren't very ergonomic; despite this, once you get used to using them, you don't really notice.", product_id: 47, ratings: 5, reviewer_id: 1, proof: nil},
