  {compensation_id: 0, review_content: "I like that it's cheap, that it's over the counter and doesn't come with a risk of dependency, that the tablets are small and easy to swallow, and that it helps me fall asleep much faster than I could on my own (30 minutes vs 2+ hours). What I dislike about it is that it doesn't actually help me stay asleep and that I have to take 2 or 3 tablets for it to actually work. Also, I've found that when I take 3 tablets, it actually causes me to have nightmares.", product_id: 98, ratings: 4, reviewer_id: 1, proof: nil},
