  {compensation_id: 0, review_content: "I like the batteries just fine, and honestly couldn't be more pleased with the company that I bought them from. They were considerably cheaper than other brands were charging for an 8 pack, and the shipping was free and arrived much sooner than was expected. When my first package arrived, my batteries were damaged. I contacted the company to determine if they were safe to use, and after they did a quality control check, determined that they were damaged during shipping. They immediately sent me a replacement pack. Most companies don't understand the value of good customer service, and would have just said: \"sorry, there is not our fault.\" I appreciate a company that wants to do right by their customers. It's how you create repeat business. I would recommend both the company and its products.", product_id: 106, ratings: 5, reviewer_id: 1, proof: nil},
  {compensation_id: 0, review_content: "What I like about this item is that it has an enhanced base, built-in microphone. It connects over Bluetooth. The sound isn't as good as my set of Beats headphones, but it is better than some of the other wireless brands that I have tried. What I dislike about them: The instruction manual is not written in a clear manner, and there is very little information.  The power button isn't clearly marked, and one is supposed to wait for a tone and flashing LED light to turn from red to blue when you first power it on. You can't see the lights unless you are looking into the input jack.  Unlike my other wireless headphones, it doesn't come with an external Bluetooth adapter so that it can be paired with a device (ie laptop/computer that doesn't have an internal Bluetooth antenna). Also, the USB charging cables and auxiliary cord are ridiculously short.  There is also no mention in the manual on charging time and life of headphones between charges.", product_id: 107, ratings: 4, reviewer_id: 1, proof: nil},
